import { ArrowLeftRounded, ArrowRightRounded, Style, } from "@material-ui/icons"
import styled from "styled-components"

const Container = styled.div`
height: 100vh;
width: 100%;
display: flex;
position: relative;
`

const Arrow = styled.div`
width: 50px;
height: 50px;
background-color: lightgrey;
border-radius: 50%;
display: flex;
align-items: center;
justify-content: center;
position: absolute;
top: 0;
bottom: 0;
margin: auto;
left: ${props => props.direction === "left" && "10 px"};
right: ${props => props.direction === "right" && "10 px"};
cursor: poninter;
opacity:
`;

const Wrappper = styled.div`
    height: 100%;
`
const Slide = styled.div`
width: 100vh;
height: 100vh;
display: flex;
align-items: center;
`;

const ImgContainer = styled.div`
height: 100%;
flex: 1;
`;

const Image = styled.img`
height: 80%;

`

const InfoContainer = styled.div`
flex: 1;
padding: 50px;
 `;

const Title = styled.h2``;
const Description = styled.p``
const Button = styled.button``


const Galerie = () => {
    return (
        <Container>
            <Arrow direction="left" >
                <ArrowLeftRounded />
            </Arrow>
            <Wrappper>
                <Slide>
                    <ImgContainer>
                        <Image src="" />
                    </ImgContainer>
                    <InfoContainer>
                        <Title></Title>
                        <Description></Description>
                        <Button></Button>
                    </InfoContainer>
                </Slide>
            </Wrappper>
            <Arrow direction="right" >
                <ArrowRightRounded />
            </Arrow>
        </Container>
    );
};

export default Galerie
